import React, { Component } from 'react';
import './App.css';
import Jobs from './Jobs/Jobs';

class App extends Component {
  state = {
    jobs: [
      {id:'aa', name: 'Juan', age: 23},
      {id:'ab', name: 'G', age:27 },
      {id:'ac', name: 'Tito', age:18}
    ]
  }



  render() {
    const style = {
      backgroundColor: 'green',
      color: 'white',
      font: 'inherit',
      border: '1px solid blue',
      padding: '8px',
      cursor: 'pointer',
      ':hover': {
        backgroundColor: 'lightgreen',
        color: 'black'
      }
    }

    let jobs = (
      <div>
        {this.state.jobs.map(job => {
          return <Jobs 
          name={job.name} 
          age={job.age}
          key ={job.id}
          />
        })}
      </div>
    );


    return (
      <div className="App">
        <h1> Api-project</h1>
        <p>Jobs Skills</p> 
        {jobs}
      </div>
    );
  }
}

export default App;
